import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import api from '../service/api';

export default function BreedPage() {
  const { breed } = useParams();
  const [imageUrl, setImageUrl] = useState(null);

  useEffect(() => {
    const fetchImage = async () => {
      try {
        const response = await api.get(`breed/${breed}/images/random`);
        if (response.data) {
          setImageUrl(response.data.message);
        } else {
          console.error('Erro ao buscar imagem da raça:', breed);
        }
      } catch (error) {
        console.error('Erro ao buscar imagem da raça:', breed, error);
      }
    };

    fetchImage();
  }, [breed]);

  return (
    <div>
      <h2>Imagem da Raça {breed}</h2>
      {imageUrl && <img src={imageUrl} alt={`Imagem da raça ${breed}`} />}
    </div>
  );
}
